Text::Text()
{
    _Owner = nullptr;
    Init();
}

Text::Text(Entity* owner)
{
    _Owner = owner;
    Init();
}

void Text::Init()
{
    texture_buffer = 0;
    vertex_buffer = 0;
    uv_buffer = 0;
}

Text::~Text()
{
    //delete _texture;
}

void Text::SetText(std::string text, float x, float y, float size, uint8_t Color, const char* TGAfont)
{
    _x = x;
    _y = y;
    _size = size;
    if (!TGAfont[0])
    {
        _texture = _instance->GetTexture(bittext, 128, 64);
        texture_buffer = _texture->GetTexBuffer();
    }
    else
    {
        _texture = _instance->GetTexture(text.c_str(), true);
        texture_buffer = _texture->GetTexBuffer();
    }
    textColor = _texture->Palette[Color];
    glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MIN_FILTER, GL_NEAREST_MIPMAP_NEAREST);
    glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MAG_FILTER, GL_NEAREST);

    EditText(text);
}

void Text::EditText(std::string text)
{
    _count = 0;
    float linex = 0.0f;
    float liney = 0.0f;
    linex = _x;

    for (int i = 0; i < text.size(); i++)
    {
        if (text[i] == char(10))
        {
            liney += 0.1251f * 8.0f * _size;// Change 8.0f to linelength
            _x = linex;
        }
        else
        {
            vertex_buffer_vector.push_back((_x - 2.0f) / 2.0f);//keep
            vertex_buffer_vector.push_back((_y - liney) + (_size - 1.0f));//change
            vertex_buffer_vector.push_back(0.0f);
            vertex_buffer_vector.push_back((_x + (_size - 2.0f)) / 2.0f);//change
            vertex_buffer_vector.push_back((_y - liney) + (_size - 1.0f));//change
            vertex_buffer_vector.push_back(0.0f);
            vertex_buffer_vector.push_back((_x + (_size - 2.0f)) / 2.0f);//change
            vertex_buffer_vector.push_back((_y - liney) - 1.0f);//keep
            vertex_buffer_vector.push_back(0.0f);

            vertex_buffer_vector.push_back((_x + (_size - 2.0f)) / 2.0f);//change
            vertex_buffer_vector.push_back((_y - liney) - 1.0f);//keep
            vertex_buffer_vector.push_back(0.0f);
            vertex_buffer_vector.push_back((_x - 2.0f) / 2.0f);//keep
            vertex_buffer_vector.push_back((_y - liney) - 1.0f);//keep
            vertex_buffer_vector.push_back(0.0f);
            vertex_buffer_vector.push_back((_x - 2.0f) / 2.0f);//keep
            vertex_buffer_vector.push_back((_y - liney) + (_size - 1.0f));//change
            vertex_buffer_vector.push_back(0.0f);
            _x += _size;// /spacebetweencharacters

            char character = text[i];
            float uv_x = (character % 16) / 16.0f;
            float uv_y = (character / 16) / 8.0f;

            uv_buffer_vector.push_back(uv_x);
            uv_buffer_vector.push_back((1.0f - uv_y) + 0.25f);

            uv_buffer_vector.push_back(uv_x + 0.0625f / 1.5f);
            uv_buffer_vector.push_back((1.0f - uv_y) + 0.25f);

            uv_buffer_vector.push_back(uv_x + 0.0625f / 1.5f);
            uv_buffer_vector.push_back(1.0f - uv_y + 0.1251f);

            uv_buffer_vector.push_back(uv_x + 0.0625f / 1.5f);
            uv_buffer_vector.push_back(1.0f - uv_y + 0.1251f);

            uv_buffer_vector.push_back(uv_x);
            uv_buffer_vector.push_back(1.0f - uv_y + 0.1251f);

            uv_buffer_vector.push_back(uv_x);
            uv_buffer_vector.push_back((1.0f - uv_y) + 0.25f);
            _count++;
        }
    }
    _x = linex;
    glGenBuffers(1, &vertex_buffer);
    glBindBuffer(GL_ARRAY_BUFFER, vertex_buffer);
    glBufferData(GL_ARRAY_BUFFER, 72 * _count, vertex_buffer_vector.data(), GL_STATIC_DRAW);

    glGenBuffers(1, &uv_buffer);
    glBindBuffer(GL_ARRAY_BUFFER, uv_buffer);
    glBufferData(GL_ARRAY_BUFFER, 48 * _count, uv_buffer_vector.data(), GL_STATIC_DRAW);
    vertex_buffer_vector.clear();
    uv_buffer_vector.clear();
}

void Text::DoIt(GLuint shader)
{
    GLuint ColorID = glGetUniformLocation(shader, "blendColor");
    glUniform4f(ColorID, textColor.r / 255.0f, textColor.g / 255.0f, textColor.b / 255.0f, 1.0f);
    glBindTexture(GL_TEXTURE_2D, texture_buffer);

    GLuint vertexPositionID = glGetAttribLocation(shader, "vertexPosition");
    glEnableVertexAttribArray(vertexPositionID);
    glBindBuffer(GL_ARRAY_BUFFER, vertex_buffer);
    glVertexAttribPointer(
        vertexPositionID,   // attribute 0. No particular reason for 0, but must match the layout in the shader.
        3,                  // size
        GL_FLOAT,           // type
        GL_FALSE,           // normalized?
        0,                  // stride
        (void*)0            // array buffer offset
    );
    // Draw the triangle !
    GLuint vertexUVID = glGetAttribLocation(shader, "vertexUV");
    glEnableVertexAttribArray(vertexUVID);
    glBindBuffer(GL_ARRAY_BUFFER, uv_buffer);
    glVertexAttribPointer(
        vertexUVID,                       // attribute. No particular reason for 1, but must match the layout in the shader.
        2,                                // size
        GL_FLOAT,                         // type
        GL_FALSE,                         // normalized?
        0,                                // stride
        (void*)0                          // array buffer offset
    );

    //glBindVertexArray(entity->GetComponent<Sprite>()->VertexArrayID);
    glDrawArrays(GL_TRIANGLES, 0, 6 * _count); // Starting from vertex 0; 3 vertices total -> 1 triangle
    glDisableVertexAttribArray(vertexPositionID);
    glDisableVertexAttribArray(vertexUVID);
    glDisableVertexAttribArray(ColorID);
}